var vue=new Vue({el:"#ExportHocVienIndex",data:{title:"Export Học Viên"},methods:{forceFileDownload(e,o){const t=window.URL.createObjectURL(new Blob([e.data])),n=document.createElement("a");n.href=t,n.setAttribute("download",o+".xlsx"),document.body.appendChild(n),n.click()},async onExport(){let e=this;await axios({url:"/HocVien/Export",method:"get",responseType:"blob"}).then(function(o){e.forceFileDownload(o,"DanhSachHocVien")}).catch(function(e){console.log(e)})}}});